describe("refresh() Method Tests",function(){var a;afterEach(function(){if(a){a.destroy()}});it("does not convert a non-range slider into a range slider when invoked",function(){a=new Slider("#testSlider1",{min:0,max:10,value:5});var b=a.getValue();var d=b instanceof Array;expect(d).toBeFalsy();a.refresh();var c=a.getValue();d=c instanceof Array;expect(d).toBeFalsy()})});